package main

import (
	"crypto/sha1"
	"crypto/sha256"
	"crypto/sha512"
	"flag"
	"fmt"
	"hash"
	"log"
	"os"
	"runtime/pprof"
	"time"
)

func doNothing() {

}

type SomeStruct struct {
}

func (ss *SomeStruct) DoNothing() {

}

func doOneHash(input []byte, hasher hash.Hash) {
	hasher.Write(input)
	hasher.Sum(nil)
}

var cpuprofile = flag.String("cpuprofile", "", "write cpu profile to file")

func main() {

	flag.Parse()
	if *cpuprofile != "" {
		log.Println("Running with cpuprofile")
		f, err := os.Create(*cpuprofile)
		if err != nil {
			log.Fatal(err)
		}
		pprof.StartCPUProfile(f)
		// runtime.SetCPUProfileRate(100000000000000000)
		defer func() {
			pprof.StopCPUProfile()
			f.Close()
		}()
	}

	inputs := [][]byte{
		[]byte("a"),
		[]byte("abcdefghijklmnopqrztuvwxyz012345"),
		[]byte("abcdefghijklmnopqrztuvwxyz012345abcdefghijklmnopqrztuvwxyz012345abcdefghijklmnopqrztuvwxyz012345abcdefghijklmnopqrztuvwxyz012345"),
		[]byte(""),
		[]byte(""),
	}

	hashers := []hash.Hash{
		sha1.New(),
		sha256.New224(),
		sha256.New(),
		sha512.New384(),
		sha512.New(),
	}

	for i, input := range inputs {
		for h, hasher := range hashers {
			startTime := time.Now()
			for j := 0; j < 50000; j++ {
				doOneHash(input, hasher)
			}

			fmt.Println(i, h, "duration", time.Now().Sub(startTime))

			// time.Sleep(time.Millisecond * 50)
		}
	}
}
